    std::vector<long> v(n);
    for (long i = 0; i < n; i++) {
        if (i % 2 == 0) {
            v[i] = 1;
            for (long j = 2; j <= i; j++) {
                v[i] *= j;
            }
        } else {
            v[i] = 0;
            for (long j = 1; j <= i; j++) {
                v[i] += j;
            }
        }
    }
    return v;

