    long result = operand[0];
    for (int i = 0; i < op.size(); i++) {
        if (op[i] == "+") {
            result += operand[i + 1];
        } else if (op[i] == "-") {
            result -= operand[i + 1];
        } else if (op[i] == "*") {
            result *= operand[i + 1];
        } else if (op[i] == "/") {
            result /= operand[i + 1];
